package types

import (
	"regexp"

	"github.com/bwmarrin/discordgo"
	"github.com/dlclark/regexp2"
	"gorm.io/gorm"
)

type GlobalBan struct {
	Code    int64  `json:"code"`
	Status  string `json:"status"`
	Content []Ban  `json:"content"`
}

type Ban struct {
	ID        int64       `json:"ID"`
	CreatedAt string      `json:"CreatedAt"`
	UpdatedAt string      `json:"UpdatedAt"`
	DeletedAt interface{} `json:"DeletedAt"`
	Reason    string      `json:"Reason"`
}

type TransMCServer struct {
	FeedMCServer
	Address string
	Port    uint16
}

type FeedMCServer struct {
	gorm.Model
	Hash      string `gorm:"uniqueIndex"`
	GuildID   string
	ChannelID string
	RoleID    string
	Name      string
	Locale    discordgo.Locale
}

type FeedMCServers []FeedMCServer

type ImagePngHash struct {
	gorm.Model
	Hash string `gorm:"primarykey"`
	Data string `gorm:"primarykey"`
}

type Res struct {
	Code    int64       `json:"code"`
	Status  string      `json:"status"`
	Content interface{} `json:"content"`
}

type MCServer struct {
	gorm.Model
	Hash    string `gorm:"uniqueIndex"`
	Address string
	Port    uint16
	Online  bool
}

type MCServers []MCServer

type PanelEmojiConfig struct {
	Message     string
	Emojis      []*discordgo.ComponentEmoji
	MessageData *discordgo.Message
	SelectMenu  discordgo.SelectMenu
}

type MessageSelect struct {
	MemberID string
	GuildID  string
}

